    async function DownloadLyrics(uris) {
        try {
            const rawUri = uris[0];
            const uriSplit = rawUri.split(":");
            const songid = uriSplit[2];
            const songid2 = uriSplit[1];
            const uriObj = Spicetify.URI.fromString(rawUri);

            Spicetify.showNotification("Wait please...");

            const webEncendida = await verificarConexion(`http://localhost:${port}?url=test`, 5000);

            if (webEncendida) {

                let artistObject = "name";

                if (uriObj.type === Spicetify.URI.Type.PLAYLIST || uriObj.type === Spicetify.URI.Type.PLAYLIST_V2) {
                    artistObject = await CosmosAsync.get(`https://api.spotify.com/v1/playlists/${songid}`);
                }
                if (uriObj.type === Spicetify.URI.Type.ARTIST) {
                    artistObject = await CosmosAsync.get(`https://api.spotify.com/v1/artists/${songid}`);
                }
                if (uriObj.type === Spicetify.URI.Type.ALBUM) {
                    artistObject = await CosmosAsync.get(`https://api.spotify.com/v1/albums/${songid}`);
                }
                if (uriObj.type === Spicetify.URI.Type.TRACK) {
                    artistObject = await CosmosAsync.get(`https://api.spotify.com/v1/tracks/${songid}`);
                }

                artistName = artistObject.name;

                const img = new Image();
                img.src = `http://localhost:${port}?url=https://open.spotify.com/${songid2}/${songid}&type=${btoa(unescape(encodeURIComponent(songid2)))}&name=${btoa(unescape(encodeURIComponent(artistName)))}`;
                PopupModal.display({
                    title: "Downloading :D",
                    content: `Downloading lyrics ;D`,
                });
            } else {
                ShowError();
            }
        } catch (error) {
            ShowError();
        }
    }
